The function `fib` takes an input n and returns the n-th element of the Fibonacci sequence.
The base cases are when n is 0 or 1, in which case the function returns 0 and 1 respectively.
For all other n the function returns the sum of the (n-1)th and the (n-2)th elements in the sequence.
This is done by calling the function recursively for these two values.

